import React from 'react'
import {AppBar, Typography} from '@mui/material'

const Header = () => {
  return (
    <AppBar>
        <ToolBar>
            <Typography>Blogg</Typography>
        </ToolBar>
    </AppBar>
  )
}

export default Header
